import React, { useState, useEffect } from 'react'
import { useLocation } from 'react-router-dom'
import '../styles.css'
import {
  Row,
  Col,
  Collapse,
  Button,
  Card,
  CardBody,
  CardHeader,
  Nav,
  NavItem,
  NavLink,
} from 'reactstrap'
import ChooseCharts from '../chooseCharts/ChooseCharts'

const OverviewPage = () => {
  const location = useLocation()
  const [dropdownOpen, setDropdownOpen] = useState(false)
  const [windowWidth, setWindowWidth] = useState(window.innerWidth)
  const [visibleCharts, setVisibleCharts] = useState([])
  const [colSizes, setColSizes] = useState({ col1: 8, col2: 4 })
  const [isSidebarOpen, setIsSidebarOpen] = useState(true) // Estado para abrir/fechar a barra lateral

  const receivedData = location.state?.receivedData || []

  const firstChartsData = [
    {
      title: 'SunBurst',
      activeLabel: 'SunBurst',
      data: receivedData,
      showChart: true,
    },
    {
      title: 'BoxPlot',
      activeLabel: 'BoxPlot',
      data: receivedData,
      showChart: true,
    },
  ]

  const secondChartsData = [
    {
      title: 'SunBurst',
      activeLabel: 'SunBurst',
      data: receivedData,
      showChart: true,
    },
    {
      title: 'BoxPlot',
      activeLabel: 'BoxPlot',
      data: receivedData,
      showChart: true,
    },
    {
      title: 'WordCloud',
      activeLabel: 'WordCloud',
      data: receivedData,
      showChart: true,
    },
  ]

  useEffect(() => {
    const handleResize = () => setWindowWidth(window.innerWidth)
    window.addEventListener('resize', handleResize)

    return () => window.removeEventListener('resize', handleResize)
  }, [])

  useEffect(() => {
    if (windowWidth < 900) {
      setVisibleCharts(secondChartsData.slice(0, 2))
      setColSizes({ col1: 6, col2: 6 })
    } else {
      setVisibleCharts(secondChartsData)
      setColSizes({ col1: 8, col2: 4 })
    }
  }, [windowWidth])

  return (
    <div className="content full-height">
      <Row noGutters>
        {/* Menu Lateral */}
        <Col xs="2" className={`sidebar ${isSidebarOpen ? 'open' : 'closed'}`}>
          <Card>
            <CardHeader>
              <Button
                onClick={() => setIsSidebarOpen(!isSidebarOpen)}
                color="primary"
              >
                {isSidebarOpen ? 'Close Menu' : 'Open Menu'}
              </Button>
            </CardHeader>
            <Collapse isOpen={isSidebarOpen}>
              <CardBody>
                <Nav vertical>
                  <NavItem>
                    <NavLink href="#">Dashboard</NavLink>
                  </NavItem>
                  <NavItem>
                    <NavLink href="#">Reports</NavLink>
                  </NavItem>
                  <NavItem>
                    <NavLink href="#">Settings</NavLink>
                  </NavItem>
                </Nav>
              </CardBody>
            </Collapse>
          </Card>
        </Col>
        {/* Conteúdo Principal */}
        <Col xs={10} className="main-content">
          <Row className="half-height">
            {firstChartsData.map((chart, index) => {
              let cardClass = ''
              switch (index) {
                case 0:
                  cardClass = 'first-card-style-1'
                  break
                case 1:
                  cardClass = 'first-card-style-2'
                  break
                default:
                  break
              }

              return (
                <Col
                  key={index}
                  className={`half-height ${cardClass}`}
                  xs={index === 0 ? colSizes.col1 : colSizes.col2}
                >
                  <ChooseCharts
                    title={chart.title}
                    activeLabel={chart.activeLabel}
                    data={chart.data}
                    showChart={chart.showChart}
                  />
                </Col>
              )
            })}
          </Row>
          <Row className="half-height">
            {visibleCharts.map((chart, index) => {
              let cardClass = ''
              switch (index) {
                case 0:
                  cardClass = 'card-style-1'
                  break
                case 1:
                  cardClass = 'card-style-2'
                  break
                case 2:
                  cardClass = 'card-style-3'
                  break
                default:
                  break
              }

              return (
                <Col key={index} className={`half-height ${cardClass}`}>
                  <ChooseCharts
                    title={chart.title}
                    activeLabel={chart.activeLabel}
                    data={chart.data}
                    showChart={chart.showChart}
                  />
                </Col>
              )
            })}
          </Row>
        </Col>
      </Row>
    </div>
  )
}

export default OverviewPage
